import { Styled404, Text } from './styles';


import { FiArrowLeft } from 'react-icons/fi';


const Custom404 = () => {

  return (
    <Styled404>
      <div>
        <Text> This page not Found</Text>
        <Text> Error 404</Text>
      </div>
      <StyledButton> <FiArrowLeft /> Voltar</StyledButton>
    </Styled404>
  )
}

export default Custom404;
